import React from "react";
import userList from "../../data/userList";
import Card from "../Card/Card";

function UserList() {
  console.log(userList, userList[0].name);
  return (
    <div>
      <Card>
        {userList.map(user => {
          return <h2>{user.name}</h2>;
        })}
      </Card>
    </div>
  );
}

export default UserList;
